import {useState} from 'react'
import axios from 'axios'
const KEY = 'AIzaSyCl31opB_mjpKlTNGHjStEcpDiC_bhPzaI'
const baseURL = `https://www.googleapis.com/youtube/v3/search?key=${KEY}&type=video&part=snippet&maxResults=1&q=`
export default function Search(keyword) {
    //const [item, setItem] = useState();
    console.log(`${baseURL}${keyword}`)
    axios
        .get(`${baseURL}${keyword}`)
        .then(res => {
            if(res.data.items !== undefined) console.log(res.data.items);
        })
        
    //if(item) return item;  
}
